import React, { useEffect } from 'react'
import Header from '../components/Header'
import HeaderContent from '../components/HeaderContent'
import Article from '../components/Article'
import Article2 from '../components/Article2'
import Footer from '../components/Footer'
import { BrowserRouter, Router, Routes } from 'react-router-dom'
import { configureStore, createSlice } from '@reduxjs/toolkit'
import { useDispatch, useSelector } from 'react-redux'

const All = () => {
  useEffect(() => {
    document.title = "Soov Home | Home"
  }, [])
  const userManagamentSlice = createSlice({
    name: "userManagament",
  });

  const store = configureStore({
    reducer: userManagamentSlice.reducer,
  });
  const dispatch = useDispatch();
  const { dortmund, han, countt } = useSelector((state) => state.userManagament);
  return (
    <div className='relative'>
      <div className="imageView fixed max-w-[100%] z-70 min-w-[100%] max-h-[100vh] min-h-[100vh] flex items-center justify-center">
        <img src={dortmund[countt].id} className='min-w-[85%] max-w-[85%] max-h-[70vh] min-h-[70vh]' alt="" />
      </div>
      <Header />
      <HeaderContent />
      <Article />
      <Article2 />
      <Footer />
    </div>
  )
}

export default All
